import React, { useEffect, useState } from "react";
import Doc from "../img/images/doc.png";
import Share from "../img/svg/share.svg";
import "../css/header.css";
import Editor from "./editor";
import { generateRandomText, shortenUrl, encryptText, stringToHex } from "../utils/helpers";

const encryptionKey = 'SecretKey123';

export default function Header() {
  const [docName, setDocName] = useState("Untitled Document");

  useEffect(() => {
    document.title = `${docName} - Google Docs Clone`;

    const mediaQuery = window.matchMedia("(max-width: 805px)");
    const text = document.querySelector(".ellipsis");

    const handleMediaQueryChange = (query) => {
      if (query.matches) {
        text.innerText = "........";
      } else {
        text.innerText = "Format";
      }
    };

    handleMediaQueryChange(mediaQuery);
    mediaQuery.addListener(handleMediaQueryChange);

    return () => {
      mediaQuery.removeListener(handleMediaQueryChange);
    };
  }, [docName]);

  const options = ["File", "Edit", "View", "Insert", "Format", "Tools", "Extensions", "Help"];

  const changeDocTitle = (event) => {
    let name = event.target.value.trim();
    if (!name.length) {
      name = "Untitled Document";
    }

    setDocName(name);
  };

  const generateDocument = () => {
    const element = document.getElementById("editor");
    const html = element.innerHTML;
    const encryptedText = encryptText(html, encryptionKey);
    const link = `${window.location.href}document/${encryptedText}`;

    shortenUrl(link)
      .then((shortenedUrl) => {
        navigator.clipboard.writeText(shortenedUrl)
          .then(() => {
            console.log("Text copied successfully!");
            document.getElementById("share__p").innerText = "Copied";
            setTimeout(() => {
              document.getElementById("share__p").innerText = "Share";
            }, 1000);
          })
          .catch((error) => {
            console.error("Unable to copy text: ", error);
          });
      })
      .catch((error) => {
        console.error("Error shortening URL: ", error);
      });
  };

  return (
	<div className="main__header">
	  <section className="header">
		<span className="doc__info">
		  <img src={Doc} className="logo" alt="Document Logo" />
		  <span className="doc__edit">
			<span>
			  <input className="doc__name" maxLength={50} id="doc__name" value={docName} onChange={changeDocTitle} />
			  <i className="bx bx-star"></i>
			  <i className="bx bx-folder-plus"></i>
			  <i className="bx bxl-google-cloud"></i>
			</span>
			<span className="options">
			  {options.map((option, index) => (
				<p key={index} className={`option ${index === 4 ? "ellipsis" : ""}`}>
				  {option}
				</p>
			  ))}
			</span>
		  </span>
		  <span className="user">
			<i className="bx bx-history"></i>
			<i className="bx bx-comment-detail"></i>
			<i className="bx bx-video"></i>
			<span>
			  <a className="share__doc button" onClick={generateDocument} id="share__doc">
				<img src={Share} alt="Share Icon" />
				<p id="share__p">Share</p>
			  </a>
			  <span id="share__doc_copy" style={{ display: "none" }}>
				<a className="share__doc button">
				  <img src={Share} alt="Share Icon" />
				  <p>Share</p>
				</a>
			  </span>
			</span>
			<img src={`https://api.dicebear.com/6.x/adventurer/svg?seed=${generateRandomText(3)}`} className="avatar" alt="User Avatar" />
		  </span>
		</span>
	  </section>
	  <span id="main_editor">
		<Editor />
	  </span>
	</div>
  );

}
